// –ü–æ–ª—É—á–∞–µ–º –¥–∞–Ω–Ω—ã–µ –æ—Ç –ø—Ä–µ–¥—ã–¥—É—â–µ–≥–æ —É–∑–ª–∞
const inputData = $input.all()[0].json;

// –ü—Ä–æ–≤–µ—Ä—è–µ–º –Ω–∞–ª–∏—á–∏–µ –¥–∞–Ω–Ω—ã—Ö
if (!inputData || !inputData.processed_video_key) {
  throw new Error("‚ùå –û—Ç—Å—É—Ç—Å—Ç–≤—É–µ—Ç processed_video_key!");
}

// –ò–∑–≤–ª–µ–∫–∞–µ–º processed_video_key
const videoKey = inputData.processed_video_key; // –ù–∞–ø—Ä–∏–º–µ—Ä, 'video/video_ovvKb7TLg8DG.mp4'

// –£–∫–∞–∑—ã–≤–∞–µ–º URL –ø—Ä–æ–µ–∫—Ç–∞ Supabase
const supabaseProjectUrl = 'https://amhfcqfsugtoxsgrqdfa.supabase.co';

// –§–æ—Ä–º–∏—Ä—É–µ–º –ø—É–±–ª–∏—á–Ω—É—é —Å—Å—ã–ª–∫—É –Ω–∞ –≤–∏–¥–µ–æ
const publicVideoUrl = `${supabaseProjectUrl}/storage/v1/object/public/${videoKey}`;

// –í–æ–∑–≤—Ä–∞—â–∞–µ–º —Ä–µ–∑—É–ª—å—Ç–∞—Ç –¥–ª—è —Å–ª–µ–¥—É—é—â–µ–≥–æ —É–∑–ª–∞
return [
  {
    json: {
      videoKey: videoKey,
      publicVideoUrl: publicVideoUrl,
      originalData: inputData
    }
  }
];

// –ü–æ–ª—É—á–∞–µ–º –¥–∞–Ω–Ω—ã–µ –∏–∑ –ø—Ä–µ–¥—ã–¥—É—â–µ–≥–æ —à–∞–≥–∞
const responseData = $input.item.json;

// –ù–∞—Ö–æ–¥–∏–º –∫–æ–Ω—Ç–µ–Ω—Ç –≤ –º–∞—Å—Å–∏–≤–µ (–º–æ–∂–µ—Ç –±—ã—Ç—å –≤ —Ä–∞–∑–Ω—ã—Ö —Å—Ç—Ä—É–∫—Ç—É—Ä–∞—Ö)
let content = '';
if (Array.isArray(responseData) && responseData.length > 0) {
  content = responseData[0].message?.content || responseData[0].content || '';
} else if (responseData.message?.content) {
  content = responseData.message.content;
} else if (responseData.content) {
  content = responseData.content;
}

// –ò–∑–≤–ª–µ–∫–∞–µ–º Title –∏ Description
const titleMatch = content.match(/- Title:\s*(.*?)(?=\n- Description:|\n\n|$)/s);
const descriptionMatch = content.match(/- Description:\s*(.*?)(?=\n#|$)/s);

const title = titleMatch ? titleMatch[1].trim() : '';
const description = descriptionMatch ? descriptionMatch[1].trim() : '';

// –í–æ–∑–≤—Ä–∞—â–∞–µ–º —Ä–µ–∑—É–ª—å—Ç–∞—Ç
return {
  ...($input.item.json),
  generated_title: title,
  generated_description: description,
  original_content: content
};

// =================================
// –ù–ê–°–¢–†–û–ô–ö–ê –ö–ê–ß–ï–°–¢–í–ê –ö–û–ù–¢–ï–ù–¢–ê INSTAGRAM
// =================================
// –ò–∑–º–µ–Ω–∏—Ç–µ –∑–Ω–∞—á–µ–Ω–∏–µ –æ—Ç 1 –¥–æ 10:
// 10 = –¢–æ–ª—å–∫–æ –∞–±—Å–æ–ª—é—Ç–Ω—ã–µ —Ö–∏—Ç—ã (2-3 –≤–∏–¥–µ–æ/–Ω–µ–¥–µ–ª—é)
// 9 = –¢–æ–ø–æ–≤—ã–µ —Ö–∏—Ç—ã (3-4 –≤–∏–¥–µ–æ/–Ω–µ–¥–µ–ª—é)
// 8 = –û—Ç–ª–∏—á–Ω–æ–µ –∫–∞—á–µ—Å—Ç–≤–æ (6-8 –≤–∏–¥–µ–æ/–Ω–µ–¥–µ–ª—é) ‚≠ê –†–ï–ö–û–ú–ï–ù–î–£–ï–¢–°–Ø
// 7 = –•–æ—Ä–æ—à–µ–µ –∫–∞—á–µ—Å—Ç–≤–æ (8-10 –≤–∏–¥–µ–æ/–Ω–µ–¥–µ–ª—é)
// 6 = –ù–µ–ø–ª–æ—Ö–æ–µ –∫–∞—á–µ—Å—Ç–≤–æ (10-12 –≤–∏–¥–µ–æ/–Ω–µ–¥–µ–ª—é)
// 5 = –°—Ä–µ–¥–Ω–µ–µ –∫–∞—á–µ—Å—Ç–≤–æ (12-15 –≤–∏–¥–µ–æ/–Ω–µ–¥–µ–ª—é)
// 4 = –ù–∏–∂–µ —Å—Ä–µ–¥–Ω–µ–≥–æ (15-18 –≤–∏–¥–µ–æ/–Ω–µ–¥–µ–ª—é)
// 3 = –°–ª–∞–±–æ–µ –∫–∞—á–µ—Å—Ç–≤–æ (18-20 –≤–∏–¥–µ–æ/–Ω–µ–¥–µ–ª—é)
// 1-2 = –õ—é–±–æ–µ –∫–∞—á–µ—Å—Ç–≤–æ (~20 –≤–∏–¥–µ–æ/–Ω–µ–¥–µ–ª—é)
const QUALITY_LEVEL = 7; // ‚≠ê –û–ø—Ç–∏–º–∞–ª—å–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ –¥–ª—è –±–∞–ª–∞–Ω—Å–∞ –∫–∞—á–µ—Å—Ç–≤–∞ –∏ –∫–æ–ª–∏—á–µ—Å—Ç–≤–∞

// =================================
// –ü–æ—Ä–æ–≥–æ–≤—ã–µ –∑–Ω–∞—á–µ–Ω–∏—è –¥–ª—è —Ñ–∏–ª—å—Ç—Ä–∞—Ü–∏–∏
// =================================
const qualitySettings = {
  10: { threshold: 86, min: 2, max: 3 },
  9:  { threshold: 68, min: 3, max: 4 },
  8:  { threshold: 65, min: 6, max: 8 },
  7:  { threshold: 60, min: 8, max: 10 },
  6:  { threshold: 50, min: 10, max: 12 },
  5:  { threshold: 40, min: 12, max: 15 },
  4:  { threshold: 30, min: 15, max: 18 },
  3:  { threshold: 20, min: 18, max: 20 },
  2:  { threshold: 10, min: 20, max: 20 },
  1:  { threshold: 5,  min: 20, max: 20 }
};

const { threshold, min: MIN_VIDEOS, max: MAX_VIDEOS } = qualitySettings[QUALITY_LEVEL] || { threshold: 65, min: 5, max: 10 };

// =================================
// –§—É–Ω–∫—Ü–∏—è —Ä–∞—Å—á—ë—Ç–∞ Instagram Score
// =================================
function calculateInstagramScore(item) {
  const views = item.videoViewCount || 0;
  const likes = item.likesCount || 0;
  const comments = item.commentsCount || 0;

  if (views === 0) return 0;

  // Engagement Rate (35%)
  const engagement = likes + (comments * 2);
  const engagementRate = (engagement / views) * 100;
  let engagementScore = 0;
  if (engagementRate >= 15) engagementScore = 35;
  else if (engagementRate >= 10) engagementScore = 30 + (engagementRate - 10) * 1;
  else if (engagementRate >= 5) engagementScore = 20 + (engagementRate - 5) * 2;
  else if (engagementRate >= 2) engagementScore = 10 + (engagementRate - 2) * 3.33;
  else engagementScore = engagementRate * 5;

  // View Velocity (25%)
  const hoursOld = item.timestamp ? 
    (Date.now() - new Date(item.timestamp).getTime()) / (1000 * 60 * 60) : 24;
  const velocity = views / Math.max(hoursOld, 1);
  let velocityScore = 0;
  if (velocity >= 100000) velocityScore = 25;
  else if (velocity >= 50000) velocityScore = 20 + (velocity - 50000) / 10000;
  else if (velocity >= 10000) velocityScore = 15 + (velocity - 10000) / 8000;
  else if (velocity >= 1000) velocityScore = 8 + (velocity - 1000) / 1285;
  else velocityScore = velocity / 125;

  // Popularity (25%)
  let popularityScore = 0;
  if (views >= 1000000) popularityScore = 25;
  else if (views >= 500000) popularityScore = 22 + (views - 500000) / 166666;
  else if (views >= 100000) popularityScore = 18 + (views - 100000) / 100000;
  else if (views >= 50000) popularityScore = 15 + (views - 50000) / 16666;
  else if (views >= 10000) popularityScore = 10 + (views - 10000) / 8000;
  else if (views >= 1000) popularityScore = 5 + (views - 1000) / 1800;
  else popularityScore = views / 200;

  // Content Quality Bonus (15%)
  let contentScore = 5;
  if (item.hashtags && item.hashtags.length > 0) {
    if (item.hashtags.length >= 5) contentScore += 4;
    else if (item.hashtags.length >= 3) contentScore += 3;
    else contentScore += 2;
  }
  if (item.musicInfo && !item.musicInfo.uses_original_audio) contentScore += 3;
  if (item.text && item.text.length > 50) contentScore += Math.min(3, item.text.length / 50);
  contentScore = Math.min(contentScore, 15);

  const totalScore = engagementScore + velocityScore + popularityScore + contentScore;
  return Math.round(Math.min(totalScore, 100));
}

// =================================
// –û–±—Ä–∞–±–æ—Ç–∫–∞ –≤–∏–¥–µ–æ
// =================================
const allItems = $input.all().map(item => item.json);

const processedItems = allItems.map(item => ({
  ...item,
  content_score: calculateInstagramScore(item)
}));

// –§–∏–ª—å—Ç—Ä–∞—Ü–∏—è –ø–æ –ø–æ—Ä–æ–≥—É
let selectedItems = processedItems.filter(item => item.content_score > threshold);

// –ï—Å–ª–∏ –Ω–µ —Ö–≤–∞—Ç–∞–µ—Ç –¥–æ –º–∏–Ω–∏–º—É–º–∞ ‚Äî –¥–æ–±–∏—Ä–∞–µ–º –ª—É—á—à–∏–µ –ø–æ —Å–∫–æ—Ä—É
if (selectedItems.length < MIN_VIDEOS) {
  console.log(`\n‚ö†Ô∏è –ú–∞–ª–æ –≤–∏–¥–µ–æ –≤—ã—à–µ –ø–æ—Ä–æ–≥–∞ (${selectedItems.length}/${MIN_VIDEOS}). –î–æ–±–∏—Ä–∞–µ–º.`);
  const extra = processedItems
    .filter(item => !selectedItems.includes(item))
    .sort((a, b) => b.content_score - a.content_score)
    .slice(0, MIN_VIDEOS - selectedItems.length);
  selectedItems = [...selectedItems, ...extra];
}

// –û–≥—Ä–∞–Ω–∏—á–∏–≤–∞–µ–º –º–∞–∫—Å–∏–º—É–º
selectedItems = selectedItems
  .sort((a, b) => b.content_score - a.content_score)
  .slice(0, MAX_VIDEOS);

const finalItems = selectedItems;

// =================================
// –°–¢–ê–¢–ò–°–¢–ò–ö–ê
// =================================
console.log('='.repeat(50));
console.log(`üìä –°–¢–ê–¢–ò–°–¢–ò–ö–ê –û–ë–†–ê–ë–û–¢–ö–ò`);
console.log('='.repeat(50));
console.log(`‚úÖ –û–±—Ä–∞–±–æ—Ç–∞–Ω–æ –≤–∏–¥–µ–æ: ${allItems.length}`);
console.log(`‚úÖ –û—Ç–æ–±—Ä–∞–Ω–æ –¥–ª—è –∑–∞–≥—Ä—É–∑–∫–∏: ${finalItems.length}`);
console.log(`‚úÖ –£—Ä–æ–≤–µ–Ω—å –∫–∞—á–µ—Å—Ç–≤–∞: ${QUALITY_LEVEL}/10`);
console.log(`‚úÖ –ü–æ—Ä–æ–≥ –∫–∞—á–µ—Å—Ç–≤–∞: ${threshold} –±–∞–ª–ª–æ–≤`);

const scoreRanges = {
  '80-100': 0,
  '60-79': 0,
  '40-59': 0,
  '20-39': 0,
  '0-19': 0
};

processedItems.forEach(item => {
  if (item.content_score >= 80) scoreRanges['80-100']++;
  else if (item.content_score >= 60) scoreRanges['60-79']++;
  else if (item.content_score >= 40) scoreRanges['40-59']++;
  else if (item.content_score >= 20) scoreRanges['20-39']++;
  else scoreRanges['0-19']++;
});

console.log('\nüìà –†–∞—Å–ø—Ä–µ–¥–µ–ª–µ–Ω–∏–µ –≤–∏–¥–µ–æ –ø–æ —Å–∫–æ—Ä–∞–º:');
Object.entries(scoreRanges).forEach(([range, count]) => {
  const percentage = ((count / allItems.length) * 100).toFixed(1);
  console.log(`   ${range}: ${count} –≤–∏–¥–µ–æ (${percentage}%)`);
});

console.log('\nüèÜ –¢–æ–ø-5 –≤–∏–¥–µ–æ –ø–æ —Å–∫–æ—Ä—É:');
processedItems
  .sort((a, b) => b.content_score - a.content_score)
  .slice(0, 5)
  .forEach((item, index) => {
    const status = item.content_score > threshold ? '‚úÖ' : '‚ùå';
    const views = item.videoViewCount ? item.videoViewCount.toLocaleString() : '0';
    const likes = item.likesCount ? item.likesCount.toLocaleString() : '0';
    console.log(`${index + 1}. ${status} Score: ${item.content_score} | Views: ${views} | Likes: ${likes}`);
  });

if (finalItems.length === 0) {
  console.log('\n‚ö†Ô∏è –í–ù–ò–ú–ê–ù–ò–ï: –ù–µ –Ω–∞–π–¥–µ–Ω–æ –≤–∏–¥–µ–æ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–≥–æ –∫–∞—á–µ—Å—Ç–≤–∞!');
  throw new Error('–ù–µ—Ç –≤–∏–¥–µ–æ –¥–ª—è –∑–∞–≥—Ä—É–∑–∫–∏');
}

return finalItems.map(item => ({ json: item }));

// =================================
// –ù–ê–°–¢–†–û–ô–ö–ê –ö–ê–ß–ï–°–¢–í–ê –ö–û–ù–¢–ï–ù–¢–ê
// =================================
// –ò–∑–º–µ–Ω–∏—Ç–µ –∑–Ω–∞—á–µ–Ω–∏–µ –æ—Ç 1 –¥–æ 10:
// 10 = –¢–æ–ª—å–∫–æ —Ö–∏—Ç—ã (1-2 –≤–∏–¥–µ–æ –∏–∑ 10) - –º–∞–∫—Å–∏–º–∞–ª—å–Ω–∞—è —Å–µ–ª–µ–∫—Ç–∏–≤–Ω–æ—Å—Ç—å
// 9 = –ü—Ä–µ–º–∏—É–º –∫–æ–Ω—Ç–µ–Ω—Ç (2-3 –≤–∏–¥–µ–æ –∏–∑ 10)
// 8 = –û—Ç–ª–∏—á–Ω–æ–µ –∫–∞—á–µ—Å—Ç–≤–æ (3-4 –≤–∏–¥–µ–æ –∏–∑ 10) 
// 7 = –û—á–µ–Ω—å —Ö–æ—Ä–æ—à–µ–µ –∫–∞—á–µ—Å—Ç–≤–æ (4-5 –≤–∏–¥–µ–æ –∏–∑ 10)
// 6 = –•–æ—Ä–æ—à–µ–µ –∫–∞—á–µ—Å—Ç–≤–æ (6-7 –≤–∏–¥–µ–æ –∏–∑ 10) ‚≠ê –†–ï–ö–û–ú–ï–ù–î–£–ï–¢–°–Ø
// 5 = –°—Ä–µ–¥–Ω–µ–µ+ –∫–∞—á–µ—Å—Ç–≤–æ (7-8 –≤–∏–¥–µ–æ –∏–∑ 10)
// 4 = –°—Ä–µ–¥–Ω–µ–µ –∫–∞—á–µ—Å—Ç–≤–æ (9 –≤–∏–¥–µ–æ –∏–∑ 10)
// 3 = –ë–∞–∑–æ–≤–æ–µ –∫–∞—á–µ—Å—Ç–≤–æ (95%+ –≤–∏–¥–µ–æ)
// 2 = –ú–∏–Ω–∏–º–∞–ª—å–Ω–∞—è —Ñ–∏–ª—å—Ç—Ä–∞—Ü–∏—è (98%+ –≤–∏–¥–µ–æ)
// 1 = –õ—é–±–æ–µ –∫–∞—á–µ—Å—Ç–≤–æ (99%+ –≤–∏–¥–µ–æ)
const QUALITY_LEVEL = 6; // ‚≠ê –û–ø—Ç–∏–º–∞–ª—å–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ –¥–ª—è –±–∞–ª–∞–Ω—Å–∞ –∫–∞—á–µ—Å—Ç–≤–∞ –∏ –∫–æ–ª–∏—á–µ—Å—Ç–≤–∞

// =================================
// –ù–ï –ò–ó–ú–ï–ù–Ø–ô–¢–ï –ö–û–î –ù–ò–ñ–ï
// =================================
const qualitySettings = {
10: 70, // –¢–æ–ª—å–∫–æ —Ç–æ–ø –≤–∏–¥–µ–æ (~10% –æ—Ç –æ–±—â–µ–≥–æ —á–∏—Å–ª–∞)
9: 65,  // –ü—Ä–µ–º–∏—É–º –∫–æ–Ω—Ç–µ–Ω—Ç (~20%)
8: 60,  // –û—Ç–ª–∏—á–Ω–æ–µ –∫–∞—á–µ—Å—Ç–≤–æ (~30%) 
7: 55,  // –•–æ—Ä–æ—à–µ–µ –∫–∞—á–µ—Å—Ç–≤–æ (~50%)
6: 50,  // –°—Ä–µ–¥–Ω–µ-—Ö–æ—Ä–æ—à–µ–µ –∫–∞—á–µ—Å—Ç–≤–æ (~70%)
5: 47,  // –°—Ä–µ–¥–Ω–µ–µ –∫–∞—á–µ—Å—Ç–≤–æ (~80%)
4: 45,  // –ë–∞–∑–æ–≤–æ–µ –∫–∞—á–µ—Å—Ç–≤–æ (~90%)
3: 42,  // –ú–∏–Ω–∏–º–∞–ª—å–Ω–∞—è —Ñ–∏–ª—å—Ç—Ä–∞—Ü–∏—è (~95%)
2: 40,  // –ü–æ—á—Ç–∏ –≤—Å—ë (~98%)
1: 35   // –ü—Ä–∞–∫—Ç–∏—á–µ—Å–∫–∏ –≤—Å—ë (~99%)
};

const threshold = qualitySettings[QUALITY_LEVEL] || 55;

function calculateContentScore(item) {
    const views = item.playCount || 0;
    const likes = item.diggCount || 0;
    const comments = item.commentCount || 0;
    const shares = item.shareCount || 0;
    const saves = item.collectCount || 0;

    if (views === 0) return 0;

    // 1. Engagement Score (40% –≤–µ—Å–∞) - –∏–∑–º–µ—Ä—è–µ—Ç –≤–æ–≤–ª–µ—á–µ–Ω–Ω–æ—Å—Ç—å –∞—É–¥–∏—Ç–æ—Ä–∏–∏
    const engagement = likes + comments + shares + saves;
    const engagementRate = (engagement / views) * 100;
    const engagementScore = Math.min(engagementRate * 2, 40);

    // 2. Velocity Score (30% –≤–µ—Å–∞) - —Å–∫–æ—Ä–æ—Å—Ç—å –Ω–∞–±–æ—Ä–∞ –ø—Ä–æ—Å–º–æ—Ç—Ä–æ–≤
    const hoursOld = (Date.now() - new Date(item.createTimeISO).getTime()) / (1000 * 60 * 60);
    const velocity = hoursOld > 0 ? views / Math.max(hoursOld, 1) : 0;
    const velocityScore = Math.min(Math.log10(velocity + 1) * 6, 30);

    // 3. Popularity Score (20% –≤–µ—Å–∞) - –æ–±—â–∞—è –ø–æ–ø—É–ª—è—Ä–Ω–æ—Å—Ç—å
    const popularityScore = Math.min(Math.log10(views + 1) * 2.5, 20);

    // 4. Content Quality Indicators (10% –≤–µ—Å–∞) - —Ç–µ—Ö–Ω–∏—á–µ—Å–∫–∏–µ –ø–æ–∫–∞–∑–∞—Ç–µ–ª–∏
    const hasHashtags = item.text && item.text.includes('#') ? 3 : 0;
    const hasMusic = item.musicMeta ? 2 : 0;
    const contentScore = 5 + hasHashtags + hasMusic;

    // –ò—Ç–æ–≥–æ–≤—ã–π –±–∞–ª–ª
    const totalScore = engagementScore + velocityScore + popularityScore + contentScore;
    return Math.round(Math.min(totalScore, 100));
}

// –û–±—Ä–∞–±–æ—Ç–∫–∞ –≤—Ö–æ–¥—è—â–∏—Ö –¥–∞–Ω–Ω—ã—Ö
const allItems = $input.all().map(item => item.json);

const processedItems = allItems.map(item => ({
    ...item,
    content_score: calculateContentScore(item)
}));

// –§–∏–ª—å—Ç—Ä–∞—Ü–∏—è –ø–æ –ø–æ—Ä–æ–≥—É –∫–∞—á–µ—Å—Ç–≤–∞
const selectedItems = processedItems.filter(item => item.content_score > threshold);

// –°–æ—Ä—Ç–∏—Ä–æ–≤–∫–∞ –ø–æ —É–±—ã–≤–∞–Ω–∏—é –∫–∞—á–µ—Å—Ç–≤–∞
const finalItems = selectedItems.sort((a, b) => b.content_score - a.content_score);

// –í—ã–≤–æ–¥ —Å—Ç–∞—Ç–∏—Å—Ç–∏–∫–∏
console.log(`‚úÖ –û–±—Ä–∞–±–æ—Ç–∞–Ω–æ: ${allItems.length} –≤–∏–¥–µ–æ`);
console.log(`‚úÖ –û—Ç–æ–±—Ä–∞–Ω–æ –¥–ª—è –∑–∞–≥—Ä—É–∑–∫–∏: ${finalItems.length} –≤–∏–¥–µ–æ`);
console.log(`‚úÖ –£—Ä–æ–≤–µ–Ω—å –∫–∞—á–µ—Å—Ç–≤–∞: ${QUALITY_LEVEL}/10 (–ø–æ—Ä–æ–≥: ${threshold} –±–∞–ª–ª–æ–≤)`);
console.log(`üìä –ü—Ä–æ—Ü–µ–Ω—Ç –æ—Ç–±–æ—Ä–∞: ${Math.round((finalItems.length / allItems.length) * 100)}%`);

if (finalItems.length === 0) {
    throw new Error('‚ö†Ô∏è –ù–µ –Ω–∞–π–¥–µ–Ω–æ –≤–∏–¥–µ–æ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–≥–æ –∫–∞—á–µ—Å—Ç–≤–∞. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ —Å–Ω–∏–∑–∏—Ç—å QUALITY_LEVEL');
}

// –í–æ–∑–≤—Ä–∞—Ç –æ—Ç—Ñ–∏–ª—å—Ç—Ä–æ–≤–∞–Ω–Ω—ã—Ö —Ä–µ–∑—É–ª—å—Ç–∞—Ç–æ–≤
return finalItems.map(item => ({ json: item }));

// –ö–æ–¥ –¥–ª—è Code –Ω–æ–¥—ã –≤ n8n –¥–ª—è —Ñ–∏–ª—å—Ç—Ä–∞—Ü–∏–∏ –¥—É–±–ª–∏–∫–∞—Ç–æ–≤

// –ü–æ–ª—É—á–∞–µ–º –≤—Å–µ –≤—Ö–æ–¥–Ω—ã–µ –¥–∞–Ω–Ω—ã–µ
const allItems = $input.all();

// –†–∞–∑–¥–µ–ª—è–µ–º –¥–∞–Ω–Ω—ã–µ –ø–æ —Ç–∏–ø—É –∏—Å—Ç–æ—á–Ω–∏–∫–∞
