// –°–æ–∑–¥–∞–µ–º Set —Å —Å—É—â–µ—Å—Ç–≤—É—é—â–∏–º–∏ URL –∏ ID –¥–ª—è –±—ã—Å—Ç—Ä–æ–≥–æ –ø–æ–∏—Å–∫–∞
