// ======= –£–õ–£–ß–®–ï–ù–ù–ê–Ø –í–ï–†–°–ò–Ø –° –ü–ï–†–ï–ë–û–†–û–ú –í–°–ï–• –ù–û–í–û–°–¢–ï–ô –ò –û–ì–†–ê–ù–ò–ß–ï–ù–ò–ï–ú –ü–û–ü–´–¢–û–ö =======

function filterNewsWithAdvancedChecks(existingPosts, searchResults) {
  console.log('–ù–∞—á–∏–Ω–∞–µ–º —Ñ–∏–ª—å—Ç—Ä–∞—Ü–∏—é –Ω–æ–≤–æ—Å—Ç–µ–π...');

  // üõ†Ô∏è –†–ï–ñ–ò–ú –û–¢–õ–ê–î–ö–ò - —É—Å—Ç–∞–Ω–æ–≤–∏—Ç–µ true –¥–ª—è –ø—Ä–æ–ø—É—Å–∫–∞ –≤—Å–µ—Ö —Ñ–∏–ª—å—Ç—Ä–æ–≤
  const DEBUG_MODE = false; // –£—Å—Ç–∞–Ω–æ–≤–∏—Ç–µ –≤ true –¥–ª—è –æ—Ç–ª–∞–¥–∫–∏

