  if (!searchResults || !searchResults.organic_results || searchResults.organic_results.length === 0) {
    console.log('–ù–µ—Ç —Ä–µ–∑—É–ª—å—Ç–∞—Ç–æ–≤ –ø–æ–∏—Å–∫–∞ –¥–ª—è –æ–±—Ä–∞–±–æ—Ç–∫–∏');
    return [{
