      return titleMatch ? titleMatch[1].toLowerCase() : null;
    })
    .filter(title => title !== null);

  console.log(`–ù–∞–π–¥–µ–Ω–æ ${existingLinks.length} —Å—É—â–µ—Å—Ç–≤—É—é—â–∏—Ö —Å—Å—ã–ª–æ–∫`);
  console.log(`–ù–∞–π–¥–µ–Ω–æ ${existingTitles.length} —Å—É—â–µ—Å—Ç–≤—É—é—â–∏—Ö –∑–∞–≥–æ–ª–æ–≤–∫–æ–≤`);
  console.log(`–ö –æ–±—Ä–∞–±–æ—Ç–∫–µ: ${searchResults.organic_results.length} –Ω–æ–≤–æ—Å—Ç–µ–π`);

  // –î–ò–ê–ì–ù–û–°–¢–ò–ö–ê
  console.log('üîç –°–£–©–ï–°–¢–í–£–Æ–©–ò–ï –°–°–´–õ–ö–ò:');
  existingLinks.forEach((link, i) => console.log(`  ${i+1}. ${link}`));

  console.log('üîç –ù–û–í–´–ï –°–°–´–õ–ö–ò –ò–ó –ü–û–ò–°–ö–ê:');
  searchResults.organic_results.forEach((result, i) => {
    console.log(`  ${i+1}. ${result.title} | ${result.link}`);
  });

  // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞ –ø—Ä–æ–±–ª–µ–º–Ω—ã–µ URL (—Å —É—á–µ—Ç–æ–º –æ—à–∏–±–æ–∫ 403, PDF –∏ —Ä–µ–ø–æ–∑–∏—Ç–æ—Ä–∏—è)
  function isProblematicUrl(url, title, snippet) {
    const criticalPatterns = [
      'nie jest ju≈º dostƒôpne',
      'zosta≈Ço usuniƒôte', 
      'nie istnieje',
      'b≈ÇƒÖd 404',
      'page not found',
      'resource could not be found',
      'strona nie zosta≈Ça odnaleziona',
      '/wp-admin/',
      '/admin/login',
      '/archive/old/',
      '/archiwum/stare/',
      'just a moment', // –ò–Ω–¥–∏–∫–∞—Ç–æ—Ä Cloudflare 403
      'enable javascript and cookies', // –ò–Ω–¥–∏–∫–∞—Ç–æ—Ä 403
      'pik.krakow.pl', // –ò—Å–∫–ª—é—á–µ–Ω–∏–µ –¥–ª—è pik.krakow.pl
      'krakow.pl/getPdf', // –ò—Å–∫–ª—é—á–µ–Ω–∏–µ PDF
      'repozytorium.asp.krakow.pl' // –ò—Å–∫–ª—é—á–µ–Ω–∏–µ –∞—Ä—Ö–∏–≤–Ω—ã—Ö –∑–∞–ø–∏—Å–µ–π
    ];

    const textToCheck = `${url} ${title} ${snippet}`.toLowerCase();

    for (const pattern of criticalPatterns) {
      if (textToCheck.includes(pattern)) {
        console.log(`üö´ –ö—Ä–∏—Ç–∏—á–µ—Å–∫–∞—è –ø—Ä–æ–±–ª–µ–º–∞ –≤ URL: ${pattern} –Ω–∞–π–¥–µ–Ω –≤ ${url}`);
        return true;
      }
    }

    return false;
  }

  // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞ —É—Å—Ç–∞—Ä–µ–≤—à–∏–µ URL
  function isLikelyOutdated(url, title, snippet, publishedAt) {
    const HOURS_LIMIT = 12; // –§–∏–ª—å—Ç—Ä –∑–∞ 12 —á–∞—Å–æ–≤
    const now = new Date();

    // –ü—Ä–æ–≤–µ—Ä–∫–∞ –ø–æ publishedAt, –µ—Å–ª–∏ –¥–æ—Å—Ç—É–ø–Ω–æ
    if (publishedAt) {
      const pubDate = new Date(publishedAt);
      const hoursDiff = (now - pubDate) / (1000 * 60 * 60);
      if (hoursDiff > HOURS_LIMIT) {
        console.log(`üìÖ –ù–æ–≤–æ—Å—Ç—å —É—Å—Ç–∞—Ä–µ–ª–∞ –Ω–∞ ${Math.round(hoursDiff)} —á–∞—Å–æ–≤: ${title}`);
        return true;
      }
      return false;
    }

    // Fallback: –ø—Ä–æ–≤–µ—Ä–∫–∞ –ø–æ URL
    const dateMatches = url.match(/(\d{4})[\/\-](\d{1,2})[\/\-](\d{1,2})/);
    if (dateMatches) {
      const urlDate = new Date(dateMatches[1], dateMatches[2] - 1, dateMatches[3]);
      const daysDiff = (now - urlDate) / (1000 * 60 * 60 * 24);
      if (daysDiff > 0.5) { // 0.5 –¥–Ω—è = 12 —á–∞—Å–æ–≤
        console.log(`üìÖ URL —É—Å—Ç–∞—Ä–µ–ª –Ω–∞ ${Math.round(daysDiff)} –¥–Ω–µ–π: ${url}`);
        return true;
      }
    }
    return false;
  }

  // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞ —Å—Ç–æ–ø-—Å–ª–æ–≤–∞
  function hasStopWords(title, snippet) {
    const stopWords = [
      'wojna', 'wojenny', 'wojenna', 'wojen',
      'morderstwo', 'morderstwa', 'mordercy', 'morderca',
      'obrona', 'obrony', 'obronne',
      'reklama', 'reklamy', 'reklamowy'
    ];

    const textToCheck = `${title} ${snippet}`.toLowerCase();

    for (const word of stopWords) {
      if (textToCheck.includes(word)) {
        console.log(`üö´ –°—Ç–æ–ø-—Å–ª–æ–≤–æ –Ω–∞–π–¥–µ–Ω–æ: "${word}" –≤ "${textToCheck}"`);
        return true;
      }
    }
    return false;
  }

  // –°–æ—Ä—Ç–∏—Ä–æ–≤–∫–∞ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–æ–≤ –ø–æ —Å–≤–µ–∂–µ—Å—Ç–∏
  const sortedResults = [...searchResults.organic_results].sort((a, b) => {
    const aHasDate = /\d{4}[\/\-]\d{1,2}[\/\-]\d{1,2}/.test(a.link);
    const bHasDate = /\d{4}[\/\-]\d{1,2}[\/\-]\d{1,2}/.test(b.link);

    if (!aHasDate && bHasDate) return -1;
    if (aHasDate && !bHasDate) return 1;

    if (a.position && b.position) {
      return a.position - b.position;
    }

    return 0;
  });

  const filteredReasons = {
    duplicateLink: 0,
    duplicateTitle: 0,
    problematicUrl: 0,
    outdated: 0,
    stopWords: 0
  };

  // –û—Å–Ω–æ–≤–Ω–æ–π —Ü–∏–∫–ª: –ø–µ—Ä–µ–±–∏—Ä–∞–µ–º –Ω–æ–≤–æ—Å—Ç–∏ –¥–æ –ø–µ—Ä–≤–æ–π –≤–∞–ª–∏–¥–Ω–æ–π
  for (let i = 0; i < sortedResults.length; i++) {
    const result = sortedResults[i];
