    const title = result.title;
    const snippet = result.snippet || '';
    const publishedAt = result.publishedAt || null; // –ü–æ–ª–µ –≤—Ä–µ–º–µ–Ω–∏ –ø—É–±–ª–∏–∫–∞—Ü–∏–∏

    console.log(`–ü—Ä–æ–≤–µ—Ä—è–µ–º –Ω–æ–≤–æ—Å—Ç—å ${i + 1}/${sortedResults.length}: ${title}`);

    // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞ –¥—É–±–ª–∏–∫–∞—Ç —Å—Å—ã–ª–∫–∏
    const isLinkDuplicate = existingLinksSet.has(link);
    if (isLinkDuplicate) {
      filteredReasons.duplicateLink++;
      console.log(`‚ùå –î—É–±–ª–∏–∫–∞—Ç —Å—Å—ã–ª–∫–∏: ${title} | URL: ${link}`);
      continue;
    }

    // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞ –¥—É–±–ª–∏–∫–∞—Ç –∑–∞–≥–æ–ª–æ–≤–∫–∞
    const normalizedTitle = title.toLowerCase().trim();
    const isTitleDuplicate = existingTitles.some(existingTitle => {
      const similarity = normalizedTitle === existingTitle || 
                        (normalizedTitle.length > 10 && existingTitle.includes(normalizedTitle)) ||
                        (existingTitle.length > 10 && normalizedTitle.includes(existingTitle));
      if (similarity) {
        console.log(`üîç –°—Ä–∞–≤–Ω–µ–Ω–∏–µ –∑–∞–≥–æ–ª–æ–≤–∫–æ–≤:`);
        console.log(`   –ù–æ–≤—ã–π: "${normalizedTitle}"`);
        console.log(`   –°—É—â–µ—Å—Ç–≤—É—é—â–∏–π: "${existingTitle}"`);
      }
      return similarity;
    });
    if (isTitleDuplicate) {
      filteredReasons.duplicateTitle++;
      console.log(`‚ùå –î—É–±–ª–∏–∫–∞—Ç –∑–∞–≥–æ–ª–æ–≤–∫–∞: ${title}`);
      continue;
    }

    // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞ —Å—Ç–æ–ø-—Å–ª–æ–≤–∞
    if (hasStopWords(title, snippet)) {
      filteredReasons.stopWords++;
      console.log(`‚ùå –ù–æ–≤–æ—Å—Ç—å —Å–æ–¥–µ—Ä–∂–∏—Ç —Å—Ç–æ–ø-—Å–ª–æ–≤–∞: ${title}`);
      continue;
    }

    // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞ –ø—Ä–æ–±–ª–µ–º–Ω—ã–µ URL
    if (isProblematicUrl(link, title, snippet)) {
      filteredReasons.problematicUrl++;
      console.log(`‚ùå –ü—Ä–æ–±–ª–µ–º–Ω–∞—è —Å—Å—ã–ª–∫–∞: ${title}`);
      continue;
    }

    // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞ —É—Å—Ç–∞—Ä–µ–≤—à–∏–µ URL
    if (isLikelyOutdated(link, title, snippet, publishedAt)) {
      filteredReasons.outdated++;
